import axios from 'axios'
import {useEffect, useState} from 'react'


function Tela(props){
 
    const Matches = () => {
        axios.get("https://us-central1-missao-newton.cloudfunctions.net/astroMatch/mayra-carver/matches")
        .then((res) => {
            console.log(res)
        })
    }
 
  useEffect 
    
return(
    <div>
       <h3>Nenhum Match ;)</h3>
       <h1>{props.perfil.name}</h1>
       <p>{props.perfil.age}</p>
    </div>
)

}   
export default Tela;
